INSERT INTO `posts` (`id`, `title`, `content`, `reaction`, `created`, `updated`, `image`) VALUES
(1, 'Ewa Haaglanden feestelijk van start', 'Na meer dan een jaar groeiende samenwerking was het zo ver: op woensdag 4 maart vond de feestelijke opening plaats van Ewa Haaglanden! In buurtcentrum O3, waar studenten van de entreeopleiding van ROC Mondriaan een horeca-opleiding volgen, werd de symbolische bruidstaart aangesneden. Ook werd de Ewa Haaglanden introductiefilm <linkje naar filmpje> getoond. Hierin wordt uitgelegd wat Ewa Haaglanden is, en waarom de samenwerking tussen bedrijven, gemeenten, en ROC Mondriaan zo ontzettend belangrijk is om de betrokken jongeren succesvol te begeleiden naar een diploma en werk.', NULL, '2020-03-04 11:18:00', '2020-07-11 23:57:56', '5e9733c5168fd-5f0a35e4491c9605038024.jpeg'),
(2, 'Subsidieaanvraag Ewa Haaglanden naar beoordelingscommissie', '<p>Sinds najaar 2018 is er gewerkt aan de verbinding tussen de entreeopleiding en de arbeidsmarkt. In december is dit uitgemond in een subsidieaanvraag bij het Regionaal Investeringsfonds mbo.</p>\r\n\r\n<p>De betrokken partijen &ndash; bedrijven, gemeenten, (sociaal) ondernemers, ondersteuners, en ROC Mondriaan - hebben drie routes voor ontwikkeld. Er is een blauwe route: uitgevallen studenten van de entreeopleiding van ROC Mondriaan worden begeleid naar werk, en medewerkers binnen bedrijven of mensen met een afstand tot de arbeidsmarkt worden geschoold zodat zij daarmee beter aan de slag kunnen (blijven). Er is een gele route: studenten van de entreeopleiding van ROC Mondriaan volgen de opleiding binnen het bedrijf, met ondersteuning vanuit bedrijf, gemeenten en de school.</p>\r\n\r\n<p>En er is een rode route: de reguliere entreeopleiding van ROC Mondriaan wordt door de ervaringen in de blauwe en de gele route meer arbeidsmarktrelevant gemaakt. Zie <a href=\"#\">&lt; linkje pagina met informatie&gt;</a> voor de definitieve stukken.</p>', NULL, '2020-01-31 11:17:00', '2020-07-21 14:20:15', '5e97337d8e19a-5f0a362b67232754569412.jpeg'),
(3, 'Opening samenwerkingsverband entree-arbeidsmarkt', '<p>Op 10 oktober is het samenwerkingsverband entree-arbeidsmarkt feestelijk geopend.</p>\r\n\r\n<p>Het doel van het netwerk is de arbeidsmarktpositie te verbeteren van jongeren van de entreeopleiding, mensen met een laag opleidingsniveau op de werkvloer, en mensen met een afstand tot de arbeidsmarkt. Veel organisaties in de regio Haaglanden werken hier al aan, en samen kunnen we n&oacute;g meer bereiken. In het netwerk vinden we elkaar sneller.</p>\r\n\r\n<p>Op de bijeenkomst werden regionale initiatieven gepresenteerd zoals praktijkleren met een praktijkverklaring (ROC Mondriaan i.s.m. arbeidsmarktregio Haaglanden), de Energieacademie, opleiden op de werkvloer bij thuiszorgorganisatie Florein, de samenwerking tussen de praktijkschool van het Hofstede College en ROC Mondriaan, de horeca-opleiding van Mondriaan bij buurtcentrum O3, en het regionale vsv-project Maatwerktrajecten naar onderwijs en arbeid.</p>', NULL, '2019-10-10 16:45:00', '2020-07-21 14:17:34', '5e9c640e27462-5f0c0a1ec44f2367869337.jpeg');

